import { useContext } from "react";
import { Context } from './context';

export default function Dived({str,onWordClick}){

    let list = str.split(' ');
    if (list.length === 1 && list[0] === '') {
        list = [];
    }
    return (
        <div>
            {list.map((item, index) => {
                return <span onClick={()=> onWordClick(item)} key={index}>{ `   ${item}  ` }</span>
            })}
        </div>
    )
}
